venue.description:
Holy Names University is a private, coeducational university located in Oakland, California. It is affiliated with the Roman Catholic Church and is administered by the Sisters of the Holy Names of Jesus and Mary.

The university was originally established as the Convent of Our Lady of the Sacred Heart in 1868 by six members of the Sisters of the Holy Names, a teaching order from Quebec, Canada. They were invited to Oakland by Father Michael King, Pastor of Saint Mary&#39;s Church to establish a school for girls and to provide means to train future teachers.

The original site of the convent was to be the shores of Lake Merritt. By 1909 the convent began to offer classes at a post-secondary level and was renamed the College of the Holy Names. Graduate degree programs were added in 1951 and men were first admitted only as graduate students. Soon afterward in 1957, the school moved to its present location in the Oakland Hills. In 1971 the college became coeducational and was renamed Holy Names College. The Julia Morgan School for Girls held classes for its first two years, from 1999 through 2001, at Holy Names. The school took its present name on May 10, 2004 and became known as the &quot;newest Catholic university in California.&quot;
